import React, {useState} from 'react'
import TodoList from "./TodoList";

function App() {
  const  [todos, setTodos] = useState([{id: 1, name:'Todo 1', complete: true}]);
  return (
    <>
      <TodoList todos = {todos}/>
      <input type='text'/>
      <button>Add ToDo</button>
      <button>Clear Completed Todos</button>
    </>
  );
}

export default App;
